// NOTE: audit score

/**
 * NOTE: описание
 * Делать collateral (XDC)
 * Получить borrow (FXD) - максимум 75% (133.33%) от collateral
 * Погасить borrow (FXD) + проценты (2% годовых)
 * Закрыть collateral (XDC)
 * 
 * Ликвидаторы
 * abUSD - не понятно зачем это тут и что это
 * 
 * Процент borrow динамический -- >1$ падает / <1$ растет
 * 
 * LTV = Value of FXD issued / Value of collateralized Assets = 75%
 * 
 * healf CDP --> borrow * 0,75 > collateral
 * 
 * Ценовые оракулы на свой DEX / TWAP + другие оракулы == сравнивает и если ок принимает цену
 * Обновляет раз в 15-30 минут
 * NOTE: расхождение цен может как то повлиять? -- (?) если при открытии позиции, то да разницу можно забирать в профит
 * Если не обновится цена за 30 мин, то позиция блокируется до обновления цены
